import './App.css';
import { useState } from 'react';



function Inputs() {
    return (
        <input placeholder="Add your new TODO item..." />
    );
}

function ListItem({todo}) {
    return (
        <li>{todo}</li>
    );
}

function List({todos}) {
    const items = [];

    todos.forEach(todo => {
        items.push(<ListItem todo={todo} />);
    });

    return (
        <ol>{items}</ol>
    );
}

function TODOList({ todos }) {
    return (
        <div>
            <Inputs />
            <List
                todos={todos} />
        </div>
    );
}

const TODOS = ["Item1", "Clean", "Write", "Finish"]; // + finished

export default function App() {
    return (
        <TODOList todos={TODOS} />
    );
}
